import React, { Component } from "react";

class SU extends Component {
  constructor(props) {
    super();
    this.state = this.props.show;
  }

  render() {
    if (this.state) {
      return (
        <div className="todoListMain">
          <div className="header">Add signup details here</div>
        </div>
      );
    } else {
      return;
    }
  }
}

export default SU;
